flex-basis:15rem;
background-color:#f9f7c2;
min-height:50px;
cursor:pointer;
flex-grow:1;
margin: 4%;
padding:3%;




p{
    text-align: center;
}



`
const HH = styled.div`
font-size: 3rem;
text-align: center;
  color:blue;
font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;

` 
function Project(){
return(
<>
<Main>
<Container>
<H>Any <span>Question</span></H>





</Container>
</Main>

</>
)



}
export default Project
